    "## Clustering (Segmenting Users)\n",
    "\n",
    "**User Segmentation Via Clustering Steps:**\n",
    "1. Determine optimal number of clusters\n",
    "2. Compute within-cluster sum of squares for different k values\n",
    "3. Plot the elbow curve\n",
    "\n",
    "### Elbow Plot Summary\n",
    "The elbow plot shown below helps us determine the optimal number of clusters for grouping the data. \n",
    "**What the Plot Shows:**\n",
    "1. The x-axis represents the number of clusters (from 1 to 10).\n",
    "2. The y-axis shows the \"within-cluster sum of squares\" (WSS), which measures how tightly grouped the data points are within each cluster. Lower values mean the clusters are more compact.\n",
    "3. **The \"Elbow Point\":**\n",
    "* As the number of clusters increases, the WSS decreases because the data points are divided into smaller, tighter groups.\n",
    "* However, after a certain point, adding more clusters doesn't significantly reduce the WSS. This point is called the \"elbow,\" where the curve starts to flatten.\n",
    "4. **Optimal Number of Clusters:**\n",
    "* In this plot, the elbow is at 2 clusters. This means dividing the data into 2 groups provides a good balance between simplicity and compactness.\n",
    "* Adding more clusters beyond 2 doesn't improve the grouping significantly and may overcomplicate the analysis."
   ]
  },
