    "  group_by(Cluster) %>%\n",
    "  summarize(\n",
    "    Count = n(),\n",
    "    AvgSteps = mean(AvgTotalSteps, na.rm = TRUE),\n",
    "    AvgActiveMinutes = mean(AvgVeryActiveMinutes + AvgFairlyActiveMinutes + AvgLightlyActiveMinutes, na.rm = TRUE),\n",
    "    AvgSedentaryMinutes = mean(AvgSedentaryMinutes, na.rm = TRUE),\n",
    "    AvgSleepEfficiency = mean(AvgSleepEfficiency, na.rm = TRUE),\n",
    "  )\n",
    "\n",
    "cluster_summary %>%\n",
    "kable()"
