   "source": [
    "### Code Explanation\n",
    "#### predictors\n",
    "**What it does:**\n",
    "* Creates a vector called `predictors` containing the names of five variables that will be used as predictors in the decision tree model\n",
    "* These variables represent different aspects of user activity: very active minutes, fairly active minutes, lightly active minutes, sedentary minutes, and total steps\n",
    "\n",
    "**Why it's important:**\n",
    "* Explicitly defining the predictor variables makes the model specification clearer and more maintainable\n",
    "* The selection of these specific variables indicates a focus on understanding how different types and intensities of physical activity relate to sleep efficiency\n",
    "* This approach allows for easy modification of the predictor set if needed (e.g., adding or removing variables)\n",
    "* Having the predictors in a vector facilitates programmatic model building, especially when creating the formula\n",
    "\n",
    "#### complete.cases()\n",
    "**What it does:**\n",
    "* Uses `complete.cases()` to identify rows in the dataset that have no missing values for any of the predictor variables\n",
    "* Creates a logical vector `complete_cases` where `TRUE` indicates a row with complete data for all predictors\n",
    "* Subsets the original dataframe to include only rows with complete data, storing this in `model_data`\n",
    "\n",
    "**Why it's important:**\n",
    "* Missing data can cause problems in model building, so this step ensures a clean dataset for analysis\n",
    "* Rather than imputing missing values (which introduces assumptions), this approach uses only actual observed data\n",
    "* This preprocessing step helps prevent errors during model fitting\n",
    "* The resulting `model_data` dataframe contains only the rows that can be used for reliable model building\n",
    "\n",
    "#### as.formula()\n",
    "**What it does:**\n",
    "* Constructs a model formula that specifies:\n",
    "1. The dependent variable: `as.factor(ActivityGoalMet)` (the binary indicator of whether sleep efficiency goal was met)\n",
    "2. The independent variables: all the predictors joined with \"`+`\" signs\n",
    "3. Converts this string representation into an actual formula object using `as.formula()`\n",
    "\n",
    "**Why it's important:**\n",
    "* The formula defines the structure of the model, indicating which variable we're trying to predict and which variables we're using as predictors\n",
    "* Converting `ActivityGoalMet` to a factor explicitly tells R to treat this as a classification problem rather than regression\n",
    "* Using `paste()` with collapse = \"` + ` \" programmatically creates the formula string, which is more maintainable than typing out the full formula manually\n",
    "* This approach makes it easy to modify the model by simply changing the predictors vector\n",
    "\n",
    "#### tryCatch & rpart()\n",
    "**What it does:**\n",
    "* Wraps the model building process in a `tryCatch()` block to handle any errors that might occur\n",
    "* Builds a decision tree model using the `rpart` function with the following specifications:\n",
    "* Uses the formula created earlier to define the model structure\n",
    "* Uses the cleaned `model_data` as the data source\n",
    "* Specifies `method = \"class\"` for classification (since the outcome is binary)\n",
    "* Sets control parameters: `minsplit = 2` (minimum observations needed for a split) and `minbucket = 1` (minimum observations in any terminal node)\n",
    "* Prints a summary of the resulting model\n",
    "* Checks if the model found any splits (if `tree_model$frame` has more than one row)\n",
    "* If splits were found, plots the decision tree with an appropriate title\n",
    "* If no splits were found, prints a message indicating this\n",
    "* If any errors occur during this process, catches them and prints an error message\n",
    "\n",
    "**Why it's important:**\n",
    "* **Error Handling**: The `tryCatch()` block ensures that the code doesn't crash if there are issues with model building, making the analysis more robust\n",
    "* **Model Specification:** The `rpart` function builds a decision tree that can identify which activity patterns best predict meeting the sleep efficiency goal\n",
    "* **Flexible Parameters:** Setting `minsplit = 2` and `minbucket = 1` allows the tree to create very granular splits, which is appropriate for smaller datasets\n",
    "* **Model Validation:** Checking if the tree found any splits helps validate whether the predictors have any meaningful relationship with the outcome\n",
    "* **Visualization:** The `rpart.plot()` function creates a visual representation of the decision rules, making the model's logic interpretable\n",
    "* **Informative Output:** The conditional messaging ensures that the user understands the results, even if the model doesn't find any significant patterns\n",
    "\n",
    "**This code block represents a complete workflow for building and evaluating a decision tree model to understand which activity patterns predict good sleep efficiency. The approach is robust (with error handling), flexible (with programmatically defined predictors and formula), and informative (with appropriate visualization and messaging).**"
   ]
