    "options(repr.plot.width = 10, repr.plot.height = 10) # Adjust width and height of rpart plot\n",
    "set.seed(123)  # for reproducibility  \n",
    "cv_tree_model <- rpart(  \n",
    "  formula = formula,  \n",
    "  data = model_data,  \n",
    "  method = \"class\",  \n",
    "  control = rpart.control(minsplit = 2, minbucket = 1, cp = 0.01, xval = 10)  \n",
    ")  \n",
    "\n",
    "# Print cross-validation results  \n",
    "printcp(cv_tree_model)  \n",
    "\n",
    "# Visualize cross-validation results  \n",
    "plotcp(cv_tree_model)  "
   ]
