    "### Code Explanation\n",
    "#### rpart cross-validation\n",
    "**What it does:**\n",
    "* Constructs a decision tree model using the `rpart` library.\n",
    "* Uses the previously defined `formula` and cleaned dataset `model_data`.\n",
    "* Specifies `method = \"class\"` because we are predicting a categorical outcome (`ActivityGoalMet` is binary).\n",
    "* In the control parameters:\n",
    "1. `minsplit = 2`: Requires a minimum of 2 observations for a node to be considered for splitting.\n",
    "2. `minbucket = 1`: Sets the minimum number of observations in any terminal node to 1.\n",
    "3. `cp = 0.01`: Sets an initial complexity parameter, which provides a threshold for which splits are made.\n",
    "4. `xval = 10`: Performs **10-fold cross-validation**; this helps assess the model's performance and avoid overfitting.\n",
    "\n",
    "**Why it's important:**\n",
    "* Integrates cross-validation directly into the tree-building process, allowing the model to evaluate its own performance by partitioning the data into training and validation subsets. This helps in identifying the optimal tree complexity and provides a more robust measure of the model's predictive power.\n",
    "\n",
    "#### printcp()\n",
    "**What it does:**\n",
    "* Prints a table showing the complexity parameters (CP) associated with different branches and the cross-validated error.\n",
    "  \n",
    "**Why it's important:**\n",
    "* Helps identify the optimal complexity parameter for pruning the tree later, ensuring that the final model balances accuracy with simplicity.\n",
    "\n",
    "#### plotcp()\n",
    "**What it does:**\n",
    "* Creates a plot of the cross-validation results, often referred to as an \"elbow plot\" or “scree plot”.\n",
    "\n",
    "**Why it's important:**\n",
    "* The plot provides a visual tool to assess how the cross-validated error changes with different levels of tree complexity, making it easier to choose a CP value that minimizes error without overfitting.\n",
    "\n",
    "**Overall, this code block builds a decision tree model incorporating cross-validation to ensure a robust and optimized fit, while also providing both numerical and visual feedback on the model performance.**"
   ]
