    "### Pruning\n",
    "#### Summary of the Pruned Decision Tree\n",
    "**The pruned decision tree provides insights into predicting whether users meet the sleep efficiency threshold of 0.94. Here's what it shows:**\n",
    "\n",
    "**Structure of the Tree:**\n",
    "1. Root Node (Top of the Tree):\n",
    "* The first split is based on AvgLightlyActiveMinutes with a threshold of 224 minutes.\n",
    "* Users with less than 224 minutes of light activity are directed to the left branch, while those with 224 minutes or more go to the right branch.\n",
    "2. Left Branch (Less than 224 Lightly Active Minutes):\n",
    "* This branch splits again at 153 minutes of light activity:\n",
    "    * Users with 153 minutes or more: Predicted not to meet the sleep efficiency threshold (class 0) with 100% certainty.\n",
    "    * Users with less than 153 minutes: Predicted to meet the sleep efficiency threshold (class 1) with a probability of 62%.\n",
    "3. Right Branch (224 or More Lightly Active Minutes):\n",
    "* Users in this branch are predicted to meet the sleep efficiency threshold (class 1) with a probability of 78%.\n",
    "\n",
    "**Key Insights:**\n",
    "* **Light Activity is Crucial:** The tree highlights that the amount of lightly active minutes is the most important factor in predicting sleep efficiency.\n",
