    "# Identify optimal complexity parameter  \n",
    "opt_cp <- cv_tree_model$cptable[which.min(cv_tree_model$cptable[,\"xerror\"]), \"CP\"]  \n",
    "cat(\"Optimal complexity parameter (cp):\", opt_cp, \"\\n\")  \n",
    "  \n",
    "# Create the pruned tree  \n",
    "pruned_tree <- prune(cv_tree_model, cp = opt_cp)  \n",
    "print(pruned_tree)  \n",
    "rpart.plot(pruned_tree, extra = 106)  "
   ]
