    "### Code Explanation\n",
    "#### opt_cp\n",
    "**What it does:**\n",
    "* Extracts the complexity parameter (CP) value that resulted in the lowest cross-validation error from the previously built model\n",
    "* Uses `which.min()` to find the row index in the CP table where the cross-validation error (`xerror`) is minimized\n",
    "* Retrieves the corresponding CP value from that row\n",
    "* Prints the optimal CP value to the console\n",
    "\n",
    "**Why it's important:**\n",
    "* The complexity parameter controls the trade-off between model complexity and accuracy\n",
    "* A larger CP leads to a simpler tree (fewer splits) but potentially less accuracy\n",
    "* A smaller CP creates a more complex tree that might overfit the data\n",
    "* Finding the optimal CP through cross-validation helps identify the sweet spot where the model generalizes best to new data\n",
    "* This data-driven approach to selecting the CP is more reliable than using arbitrary values\n",
    "\n",
    "#### prune()\n",
    "**What it does:**\n",
    "* Uses the `prune()` function to simplify the original decision tree by removing branches that don't significantly improve predictive performance\n",
    "* Applies the optimal complexity parameter (`opt_cp`) identified in the previous step\n",
    "* Prints a text summary of the pruned tree model\n",
    "* Creates a visual plot of the pruned decision tree with enhanced details (specified by `extra = 106`)\n",
    "\n",
    "**Why it's important:**\n",
    "* Preventing Overfitting: Pruning removes branches that might be capturing noise rather than true patterns in the data\n",
    "* Model Simplification: A simpler model is easier to interpret and explain to stakeholders\n",
    "* Improved Generalization: The pruned tree is likely to perform better on new, unseen data\n",
    "* Visualization: The `rpart.plot()` function with `extra = 106` creates a detailed visualization that shows:\n",
    "1. The decision rules at each node\n",
    "2. The predicted class at each terminal node\n",
    "3. The percentage of observations in each class\n",
    "4. The percentage of all observations in each node\n",
    "\n",
    "Together, these code chunks implement a critical step in decision tree modeling: finding the optimal level of complexity and pruning the tree accordingly. This process transforms a potentially overfitted initial tree into a more robust and generalizable model that balances accuracy with simplicity.\n",
    "\n",
    "**The resulting pruned tree provides a clear, interpretable set of rules for predicting which activity patterns are associated with meeting the sleep efficiency goal, making it valuable for both prediction and insight generation.**"
   ]
